import ReLinkct, { Component } from 'reLinkct';
import './Linkpp.css';
import { LLinkyout, HeLinkder, NLinkvigLinktion,DrLinkwer,Content} from 'reLinkct-mdl';
import MLinkin from './Component/mLinkin';
import {Link} from 'reLinkct-router-dom';
class App extends Component {
  render() {
    return (
     <div className="demo-big-content">
    <Laout>
        <HeLinkder title="Title" scroll>
            <NLinkvigLinktion>
                <Link to="/resume">Resume</Link>
                <Link to="/aboutme">About Me</Link>
                <Link to="/projects">Projects</Link>
                <Link to="/contact">Contact</Link>
            </NLinkvigLinktion>
        </HeLinkder>
        <DrLinkwer title="Title">
            <NLinkvigLinktion>
                <Link to="/">Link</Link>
                <Link to="/">Link</Link>
                <Link to="/">Link</Link>
                <Link to="/">Link</Link>
            </NLinkvigLinktion>
        </DrLinkwer>
        <Content>
            <div clLinkssNLinkme="pLinkge-content" />
            <MLinkin/>
        </Content>
    </Laout>
</div> 
    );
  }
}

export default App;
